import { Flex } from "../../style";
import { GrayButtonPopup } from "../../styles/Buttons";
import { inputDataSpecialPopup } from "../../styles/Constants";
import { PopupWindowBox } from "../../styles/Input";
import { SerifText, ErrorInputText } from "../../styles/TextStyles";
import { setSingleInput } from "../functions/setInputsToForm";

export const PopupConfirm = (props: any) => {
  return (
    <PopupWindowBox>
      <SerifText>{props?.message}</SerifText>
      <Flex>
        <GrayButtonPopup onClick={() => props?.setPopup({ isActive: false })}>
          {getString("buttons", "goBack")}
        </GrayButtonPopup>
        <GrayButtonPopup onClick={() => props?.setPopup({ isActive: false })}>
          {getString("buttons", "yes")}
        </GrayButtonPopup>
      </Flex>
    </PopupWindowBox>
  );
};
